R["fx__eu__@blackrayser__78"]="{['Version']=1759,['TS']=1629994746,['Effects']={[1]={['Contrast']=1,['X']=74589,['EffectType']=4404,['SizeZ']=40,['Pitch']=0,['Color']=999999,['SizeY']=40,['Yaw']=3.989823,['SizeX']=160,['Roll']=0,['MetaData']={['message']='RIP Children\\'s \\nBedroom',},['Id']=1022,['Alpha']=1,['Z']=76060,['Groups']=0,['Y']=17609,},[2]={['Contrast']=1.300000,['EffectType']=33,['SizeY']=540,['Pitch']=0,['X']=74155,['Color']=993921,['Yaw']=0.073304,['SizeX']=540,['Groups']=0,['Roll']=0,['Id']=1023,['Alpha']=0.440000,['Z']=74318,['SizeZ']=540,['Y']=16166,},[3]={['Contrast']=1,['EffectType']=466,['SizeY']=23,['Pitch']=0,['X']=74063,['Color']=595939,['Yaw']=1.570796,['SizeX']=23,['Groups']=0,['Roll']=0,['Id']=1025,['Alpha']=0.840000,['Z']=77244,['SizeZ']=23,['Y']=16070,},[4]={['Contrast']=1,['X']=75232,['EffectType']=4404,['SizeZ']=30,['Pitch']=0,['Color']=999999,['SizeY']=30,['Yaw']=3.926991,['SizeX']=160,['Roll']=0,['MetaData']={['message']='You are not supposed \\nto open this <-<',},['Id']=1026,['Alpha']=1,['Z']=75310,['Groups']=0,['Y']=16324,},[5]={['Contrast']=1,['EffectType']=453,['SizeY']=308,['Pitch']=5.539675,['X']=73560,['Color']=999999,['Yaw']=0.438078,['SizeX']=288,['Groups']=0,['Roll']=5.153957,['Id']=1030,['Alpha']=1,['Z']=74592,['SizeZ']=308,['Y']=16422,},[6]={['Contrast']=1,['EffectType']=453,['SizeY']=287,['Pitch']=0.645772,['X']=74786,['Color']=999999,['Yaw']=5.900958,['SizeX']=268,['Groups']=0,['Roll']=5.153957,['Id']=1031,['Alpha']=1,['Z']=74542,['SizeZ']=287,['Y']=16413,},[7]={['Contrast']=0.920000,['X']=74672,['EffectType']=8503,['SizeZ']=30,['Pitch']=1.567306,['Color']=995634,['SizeY']=30,['Yaw']=1.127483,['SizeX']=26.456456,['Roll']=0,['MetaData']={['message']='Hi folks! Welcome to my Proudspire Manor.\\n\\nMy nostalgic heart comes from TES V: Skyrim and it couldn\\'t stand to see this house being built in any other way. So this is the weird story of me trying to recreate the old Manor as accurately as possible.\\n\\nThe problem was that the old build had only 293 items in it (trust me, I counted them) so I had to add most of the extra furniture. I hope you don\\'t mind and that you will like my edits :)\\n\\nThank you for visiting and have a nice tour!\\n\\nPS. The Patio wasn\\'t part of the buildable house back in Skyrim, so I had to improvise.\\n\\nEnjoy!\\n\\nBlackRayser',['title']='From TES V: Proudspire Manor',},['Id']=1035,['Alpha']=1,['Z']=74736,['Groups']=0,['Y']=16801,},},}"
R["fx__eu__@blackrayser__23"]="{['Effects']={[1]={['Pitch']=5.152212,['SizeX']=26.456456,['Alpha']=1,['Id']=1039,['Y']=8713,['EffectType']=8503,['Yaw']=3.577925,['Groups']=0,['Z']=24381,['SizeZ']=30,['MetaData']={['message']='Name: Newton\\nSpecies: Lava Line Salamander\\nAvarage Age: 11 years\\nSex: Male\\n\\nOwner: Lidriel Vayn\\nPrimary Residence: Baandari - Malabal Tor\\n\\nDiagnosis:\\nWalkers should really do proper research before they decide to take a pet with them. This poor salamander\\'s skin was awfully dry. Being called \"Lava\" doesn\\'t mean they don\\'t need water nor wet habitat, and so here we have a dermatitis. Sigh... Hope this Wood Elf will learn the lesson, for the sake of the poor Newton.\\n\\nTreatment:\\nThis one placed the salamander in a proper case, filled it with aquatic plants and nutritious food. Moisturizing solution was also applied. It will take a while, but this little scaly friend will be perfectly fine again!',['title']='Newton Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=25463,['Roll']=0,},[2]={['Pitch']=5.134759,['SizeX']=26.456456,['Alpha']=1,['Id']=1041,['Y']=14126,['EffectType']=8503,['Yaw']=5.148721,['Groups']=0,['Z']=24678,['SizeZ']=30,['MetaData']={['message']='Name: Nigel, Rupert and Archibald\\nSpecies: Kestrel\\nApproximate Age: 3, 9 and 13 years\\nSex: Males\\n\\nOwner: Arthemisis Elsinor\\nPrimary Residence: Hollow City - Coldharbour\\n\\nExamination:\\nThose three brave kestrels are perfectly healthy and well fed. Owner brought them \\'cause she needed a safe place for birds to stay, while doing something... Weird. The High Elf spoke something about the Oblivion plane of Coldharbour and mentioned an Ayleid King, mages and many other things. Do\\'Shiri is not sure if the birds are the actual ones in need of a doctor...\\n\\nTreatment:\\nPlaced them in a big aviary, they will be safe and sound here while their owner is doing whatever she is doing...',['title']='Bird Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=24006,['Roll']=0,},[3]={['Pitch']=5.148721,['SizeX']=26.456456,['Alpha']=1,['Id']=1042,['Y']=14166,['EffectType']=8503,['Yaw']=1.933825,['Groups']=0,['Z']=24555,['SizeZ']=30,['MetaData']={['message']='Name: Firehide\\nSpecies: Deadlands Guar\\nApproximate Age: 13 years\\nSex: Female\\n\\nOwner: Corinne Lafay\\nPrimary Residence: Balmora - Vvardenfell\\n\\nComplaints:\\nThe Dunmer found her young guar rolling in a mud pool, after escaping from her paddock. Problem is that this particular mud cannot be washed! \\n\\nTreatment: \\nDo\\'shiri has never seen a stubborn hide like this in his whole life. Tried to treat the skin with different soaps, even cinder. Nothing! This one asked the owner to bring him some samples of the mud, he\\'ll need to do some experiments and try to understand why it sticks so badly on Firehide\\'s scales. She seems fine though, actually she quite enjoys all the baths!',['title']='Firehide Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=22841,['Roll']=0,},[4]={['Pitch']=5.148721,['SizeX']=26.456456,['Alpha']=1,['Id']=1043,['Y']=14128,['EffectType']=8503,['Yaw']=3.577925,['Groups']=0,['Z']=23757,['SizeZ']=30,['MetaData']={['message']='Name: Glimmersheen\\nSpecies: Hailcinder Veil Elk\\nApproximate Age: 4 years\\nSex: Female\\n\\nOwner: Clarice Redoran\\nPrimary Residence: Mournhold - Deshaan\\n\\nComplaints:\\nThe Dunmer got in touch with this one months back, she said her elk was pregnant for the very first time. Do\\'Shiri suggested to bring Glimmersheen here, so he could watch over her. The surprise was immense when he discovered she was expecting two fawns! Such a rare and dangerous event, especially for a new-mother.\\n\\nTreatment:\\nGlimmersheen was amazing! She managed to give birth on her own and both fawns are healthy and strong! They will be proud steeds on day! The walker named them Honeywine and Wetnose.',['title']='Glimmersheen Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=25164,['Roll']=0,},[5]={['Pitch']=5.141740,['SizeX']=26.456456,['Alpha']=1,['Id']=1044,['Y']=14077,['EffectType']=8503,['Yaw']=5.585054,['Groups']=0,['Z']=23369,['SizeZ']=30,['MetaData']={['message']='Name: Waggles\\nSpecies: Gloomspore Wolf\\nApproximate Age: 9 months\\nSex: Male\\n\\nOwner: Selyria Direnni\\nPrimary Residence: Lillandril - Summerset Isle\\n\\nComplaints:\\nThe High Elf said the pup\\'s fur started to disappear a couple of days ago, after they ventured in some deep caverns under the far away Skyrim mountains. Waggles seems fine, no signs of bad health nor particular diseases, but weird green spores and mushrooms covered his whole body in no time.\\n\\nTreatment:\\nThis one built a sort of cavernous habitat for the pup, using some plants the owner brought with her from the region. Do\\'Shiri will study the spores while keeping an eye on the pup\\'s health and behavior too.',['title']='Waggles Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=25037,['Roll']=0,},[6]={['Pitch']=5.235988,['SizeX']=26.456456,['Alpha']=1,['Id']=1045,['Y']=14055,['EffectType']=8503,['Yaw']=0.499164,['Groups']=0,['Z']=23316,['SizeZ']=30,['MetaData']={['message']='Name: Suspicious Egg\\nSpecies: ???\\nApproximate Age: ???\\nSex: ???\\n\\nOwner: Not owned - Comes from wildlife\\nPrimary Residence: //\\n\\nComplaints:\\nThe five-claws Deo\\'Iridh brought the egg to this one. She said she found it on the mountains, near a destroyed nest with other broken eggs. No signs of parents, nor other creatures. Must have been a fight there.\\n\\nTreatment:\\nThis one has never seen an egg like this and doesn\\'t know what will hatch from it. While continuing research, Do\\'Shiri put the egg in a safe incubator. Let\\'s wait and see. This one hopes it\\'s not too late.',['title']='Egg Clinic Folder',},['SizeY']=30,['Contrast']=1,['Color']=102439,['X']=24597,['Roll']=0,},},['Version']=1759,['TS']=1629994802,}"
