R["fx__na__@esmerauda__71"]="{['TS']=1628774339,['Version']=1757,['Effects']={[1]={['Color']=230807,['Groups']=0,['Z']=57396.232020,['Pitch']=1.570971,['SizeZ']=70,['MetaData']={['message']='Months have passed since. That day she died with them. She would no longer hear the childish laughter, she would no longer feel the caress of the hand. They were gone. It only took a spark of time for her world to stop. The last whispered words were etched in her heart. She wasn\\'t looking for peace. She wanted death, but above all, their death.\\n\\nDay one\\nFeel free to wander through the ancient paths, where the winds sing their memories\\n\\nDay 2\\nA rustlle of wings\\nThe thrill of a caress\\nthe beatings of her heart\\nThe beating of the drum\\nA breath of life\\n\\nDay 3\\nworld of softness, fragile as a butterlfy wing\\nOn the horizon a band of purple crowns the glare of the setting sun\\nHour of the evening when the light lay upon the flower its long dark silk coat.\\nThe wind abandons the strings of the harp, listening to the silence.\\nHour of reverie. Mysterious harmony of the evening. Celebration of life.\\nA world of fragrance, at the hour when perfumes exhale.\\nQuietude of the evening.\\nThe patter of rain on the burdened land derange our memories\\nSmell of wet earth speaking of nature,\\nA world without pain, without forgetting\\nTime suspends its course\\nOnly for a moment, your are there\\nI forget.',['title']='Esme thoughts',},['Contrast']=4,['Roll']=0,['SizeX']=46.456456,['Y']=29633,['SizeY']=70,['Alpha']=1,['X']=73393.232982,['Yaw']=5.070181,['Id']=1001,['EffectType']=8502,},},}"
