 I have known for several years now, you know how literally I mean this.\\n\\nThis Community is the reason that I wake up with crazy ideas, motivated and enthusiastic to create new things - things that I hope you find helpful or fun (or both) - every single morning.\\n\\nThank you for these opportunities. Thank you for restoring my passion in game development. Thank you for being there for me, for letting me be there for you, and - most importantly - for being there for each other.\\n\\nI say this often, but I will say it again: this Community is, far and away, the most kind, genuine and caring group of people that I have ever had the honor of being a member of. Most of all, thank you for that.\\n\\nI wish you all a safe and joyous holiday this year and I look forward to celebrating many more with you in the years to come.\\n\\nLove,\\nCardinal',},['Id']=61296,['Contrast']=2.700000,['SizeX']=34,['EffectType']=8503,['Yaw']=4.712389,},[5]={['Groups']=0,['SizeY']=1600,['Y']=27110,['Z']=102858,['EffectType']=906,['X']=116097,['Contrast']=1,['Alpha']=1,['Color']=292929,['Pitch']=0,['Id']=61297,['SizeZ']=1600,['SizeX']=1600,['Roll']=0,['Yaw']=4.869469,},[6]={['Groups']=0,['SizeY']=1402,['Y']=27099,['Z']=102888,['EffectType']=945,['X']=115916,['Contrast']=1,['Alpha']=1,['Color']=0,['Pitch']=0,['Id']=61298,['SizeZ']=1402,['SizeX']=1402,['Roll']=0,['Yaw']=4.897394,},[7]={['Groups']=0,['SizeY']=9000,['Y']=19548,['Z']=105585,['EffectType']=945,['X']=107642,['Contrast']=1,['Alpha']=1,['Color']=0,['Pitch']=0,['Id']=61299,['SizeZ']=9000,['SizeX']=9000,['Roll']=0,['Yaw']=5.092871,},[8]={['Groups']=0,['SizeY']=11200,['Y']=19548,['Z']=105432,['EffectType']=906,['X']=108007,['Contrast']=1,['Alpha']=1,['Color']=90909,['Pitch']=0,['Id']=61300,['SizeZ']=11200,['SizeX']=11200,['Roll']=0,['Yaw']=5.134759,},[9]={['Groups']=0,['SizeY']=1300,['Y']=30260,['Z']=100228,['EffectType']=991,['X']=123740,['Contrast']=2,['Alpha']=1,['Color']=367299,['Pitch']=0,['Id']=61301,['SizeZ']=1300,['SizeX']=1