,[2]={['Y']=13277,['Contrast']=1,['Yaw']=3.043854,['Alpha']=1,['Pitch']=0,['Groups']=0,['EffectType']=582,['SizeX']=107,['SizeZ']=70,['Id']=2033,['X']=24249,['Color']=795599,['SizeY']=70,['Z']=25008,['Roll']=0,},[3]={['Y']=13587,['Z']=24863,['MetaData']={['message']='Fezez Fortunes',},['Groups']=0,['Alpha']=1,['Pitch']=0,['SizeY']=40,['EffectType']=4403,['SizeX']=300,['SizeZ']=40,['Id']=2038,['X']=24864,['Color']=746934,['Yaw']=5.550147,['Contrast']=1,['Roll']=0,},[4]={['Y']=13562,['Z']=24857,['MetaData']={['message']='This one can see the future',},['Groups']=0,['Alpha']=1,['Pitch']=0,['SizeY']=22,['EffectType']=4403,['SizeX']=200,['SizeZ']=22,['Id']=2039,['X']=24856,['Color']=746934,['Yaw']=5.550147,['Contrast']=1,['Roll']=0,},[5]={['Y']=13488,['Z']=24843,['MetaData']={['message']='Jingle Khenarthi\\'s bells\\nPoke the enormous eye\\nGaze into the fishy mirror\\nPonder the sugar pipe smoke\\nRub Pappy\\'s lamp and make a wish',},['Groups']=0,['Alpha']=1,['Pitch']=0,['SizeY']=95,['EffectType']=4403,['SizeX']=239,['SizeZ']=95,['Id']=2040,['X']=24841,['Color']=456191,['Yaw']=5.550147,['Contrast']=1,['Roll']=0,},[6]={['Y']=13428,['Z']=24803,['MetaData']={['message']='This one knows which you will choose',},['Groups']=0,['Alpha']=1,['Pitch']=0,['SizeY']=15,['EffectType']=4403,['SizeX']=199,['SizeZ']=15,['Id']=2041,['X']=24796,['Color']=747236,['Yaw']=5.550147,['Contrast']=1,['Roll']=0,},},['HouseId']=77,['World']='eu',['Version']='15.2.5',},[8]={['TS']=1603288486,['Effects']={[1]={['Pitch']=1.570971,['Z']=155175,['MetaData']={['message']='I\\'m sure this place is haunted, I wake up and all the doors are open.\\n...\\nIt was in the Gold Coast that I first tried using alchemy to extract knowledge and power from bones, unfortunately without much success, things are going much better here however, I wonder if the cold helps the bones retain their essence. The basis of the potion is Vaermina\\'s Torpor, I have modified this to allow me to envision the memories retained within the bones.\\n...\\nI found another Watcher, I do wonder if this one was sent from Uncle Sheo, it keeps rearranging the books, yesterday it was turning them around so their spines face the wrong way, fortunately the other one seems to be trying to fix the mess.\\n...\\nToday I found a Dragon Claw, there are three symbols on the underside, a bear, a snake, and an owl, what could it mean I wonder?\\n...\\nThe guard and the maid have gone to Solitude to pick up some provisions, let\\'s hope they don\\'t come back drunk this time, if she didn\\'t bake such delicious cakes I\\'d fire the sot, she claims the contraption she uses to mix the cake batter was a gift from a daedric prince. The design is intriguing, it reminds me of a child\\'s spinning top, you push the plunger and the blades spin and spin and spin, it makes my mouth water just thinking about it, maybe a glass of wine will satiate my appetite.\\n...\\nI still can\\'t get that stupid dwarven puzzle box open, I\\'ll head to Markarth to see if I can glean anything there, though I suspect I\\'d have better luck in Winterhold.\\n...\\nThere seems to be magicka escaping from the area near the standing stones out by the lake, a woman from Solitude has come to look as she thinks there could be an antiquity buried there, I think she\\'s wrong it looks different, but I\\'ve given her permission to dig, maybe she\\'ll find more bones for me.',['title']='Journal',},['Groups']=0,['Alpha']=1,['Y']=21551,['SizeY']=30,['EffectType']=8501,['SizeX']=26.456456,['SizeZ']=30,['Id']=2070,['X']=163783,['Color']=998251,['Yaw']=2.548181,['Contrast']=1,['Roll']=0,},[2]={['Pitch']=6.108652,['Z']=156182,['MetaData']={['message']='Moo!',},['Groups']=0,['Alpha']=1,['Y']=20314,['SizeY']=22,['EffectType']=4403,['SizeX']=40,['SizeZ']=22,['Id']=2071,['X']=164671,['Color']=469899,['Yaw']=5.759587,['Contrast']=1,['Roll']=0,},[3]={['Y']=28000,['Z']=162278,['SizeY']=800,['Alpha']=1,['Pitch']=0,['Groups']=0,['EffectType']=968,['SizeX']=800,['Size